import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import '../styles/register.css';

const Register = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [phonenumber, setPhonenumber] = useState('');
  const [firstname, setFirstname] = useState('');
  const [lastname, setLastname] = useState('');
  const navigate = useNavigate();

  const handleRegister = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:3001/api/auth/register', { firstname,lastname,email,phonenumber, password });
      navigate('/login');
    } catch (err) {
      console.error(err);
    }
  };

  const login = () => { 
    navigate('/login');
  }

  return (

      <>
      <div class="container d-flex justify-content-center align-items-center min-vh-100">
    <div class="registerCard p-5 shadow">
        <div class="text-center mb-4">
            <h2 class="logoText">coek</h2>

        </div>
        <h3 class="text-center mb-4 ">Register</h3>
        <form onSubmit={handleRegister}>

          <div className='col-6'>
        <div class="mb-3 col-3">
                <label for="email" class="form-label">First Name</label>
                <input class="form-control"
            type="input"
            value={firstname}
            placeholder='samitha'
            onChange={(e) => setFirstname(e.target.value)}
            required
          />
                <div class="mb-3">
                <label for="email" class="form-label">Last Name</label>
                <input class="form-control"
            type="input"
            value={lastname}
            placeholder='Senevirathne'
            onChange={(e) => setLastname(e.target.value)}
            required
          />

            </div>
            </div>
            <div class="mb-3">
                <label for="email" class="form-label">Email address</label>
                <input class="form-control"
            type="email"
            value={email}
            placeholder='@gmail.com'
            onChange={(e) => setEmail(e.target.value)}
            required
          />

            </div>
            <div class="mb-3">
                <label for="email" class="form-label">Phone Number</label>
                <input class="form-control"
            type="number"
            value={phonenumber}
            placeholder='00000000'
            onChange={(e) => setPhonenumber(e.target.value)}
            required
          />

            </div>
            <div class="mb-2">
                <label for="password" class="form-label">Password</label>
                <input type="password" 
                value={password} 
                onChange={(e)=> setPassword(e.target.value)}  
                class="form-control " 
                id="password" placeholder="********"/>

            </div>
            <div class="mb-2">
                <label for="password" class="form-label">Confirm Password</label>
                <input type="password" 
                value={password} 
                onChange={(e)=> setPassword(e.target.value)}  
                class="form-control " 
                id="password" placeholder="********"/>

            </div>
            <div class="d-grid">
                <button type="submit" onSubmit={handleRegister} class="btn btn-primary btn-block">SIGN UP</button>
            </div>
            </div>
        </form>
        <div class="text-center mt-4">
            <p>Don't have an account? <a href="/register">Create an account</a></p>
        </div>
    </div>
</div>
</>

  );
};

export default Register;
